import React, { useState, useEffect } from 'react';

export default function Wall(props) {
    const messages = props.message



    console.log(messages)

    return (
        <div>
            <div>
                {messages ?
                    messages.map(e => {
                        return (
                            <div key={e.id}>
                                {e.message}
                            </div>
                        )
                    })
                    : null}
            </div>
        </div>
    )
}
